def main():
    data_processor = DataProcessor()
    data_processor.process_deletions()
    data_processor.update_sql_codes()
    data_processor.add_derivation_logic()
    data_processor.derive_funding_agency_code()
    data_processor.map_federal_action_obligation()
    data_processor.validate_ppopzip()

    ui_updater = UIUpdater()
    ui_updater.redesign_resources_page()
