    fabs_user = FABSUser()
    fabs_user.update_fabs_submission()
    fabs_user.add_gtas_window_data()
    fabs_user.update_fabs_sample_file()
    fabs_user.deactivate_publish_button()

    fabs_loader = FABSLoader()
    fabs_loader.derive_fields()
    fabs_loader.include_frec_derivations()

    broker_user = BrokerUser()
    broker_user.create_content_mockups()
    broker_user.submit_records()

    agency_user = AgencyUser()
    agency_user.leave_off_last_4_digits()
    agency_user.map_header_information_box()
    agency_user.include_large_number_of_flexfields()

    developer = Developer()
    developer.index_domain_models()
    developer.access_broker_application_data()

    usaspending_user = USASpendingUser()
    usaspending_user.access_raw_agency_published_files()

    d_files_generator = DFilesGenerator()
    d_files_generator.manage_d_files_generation_requests()

    fabs_uploader = FABSUploader()
    fabs_uploader.prevent_duplicate_transactions()


if __name__ == "__main__":
    main()
